restart:
	#Reset the power ups
	la $t0, picked_h
	li $t1, 0
	sw $t1, 0($t0)
	
	la $t0, picked_j
	li $t1, 0
	sw $t1, 0($t0)
	
	la $t0, picked_i
	li $t1, 0
	sw $t1, 0($t0)
	
	#Reset timer
	la $t0, timer
	li $t1, 60
	sw $t1, 0($t0)
	
	#Reset appear flag
	la $t0, appear
	li $t1, 1
	sw $t1, 0($t0)
	
	
