	la $t0, level
	li $t1, 1
	sw $t1, 0($t0)
	j boot
	

	
boot:	
	la $t0, level
	lw $t1, 0($t0)
	li $t0, 1
	li $t2, 2
	li $t3, 3
	beq $t1, $t0, level1
	beq $t1, $t2, level2
	beq $t1, $t3, level3
	
	
 
 level1:	
 	#Draw the level
 	la $t0, level_1
 	li $t1, BASE_ADDRESS
 	li $t2, 16384
 	la $t3, picked_h
 	lw $t3, 0($t3)
 	bgtz  $t3, print_no_health
 	j print_level
 	
 level2:
 	#Draw the level
 	la $t0, level_2
 	li $t1, BASE_ADDRESS
 	li $t2, 16384
 	la $t3, picked_j
 	lw $t3, 0($t3)
 	bgtz  $t3, print_no_jump
 	j print_level
 
 level3:
 	#Draw the level
 	la $t0, level_3
 	li $t1, BASE_ADDRESS
 	li $t2, 16384
 	la $t3, picked_j
 	lw $t3, 0($t3)
 	j print_level
 
 print_no_health:
 	beqz $t2, start
  	lw $t3, 0($t0)
  	beq $t3, PINK, replace
  	j cont
  replace:
  	li $t3, 0x000000 
  	j cont
  cont:
  	sw $t3, 0($t1)
  	addi $t0, $t0, 4
  	addi $t1, $t1, 4
  	addi $t2, $t2, -4
  	j print_no_health
  	
  print_no_jump:
 	beqz $t2, start
  	lw $t3, 0($t0)
  	beq $t3, GREEN, replace_j
  	j cont_j
  replace_j:
  	li $t3, 0x000000 
  	j cont_j
  cont_j:
  	sw $t3, 0($t1)
  	addi $t0, $t0, 4
  	addi $t1, $t1, 4
  	addi $t2, $t2, -4
  	j print_no_jump
  
 	
  print_level:
  	beqz $t2, start
  	
  	lw $t3, 0($t0)
  	sw $t3, 0($t1)
  	addi $t0, $t0, 4
  	addi $t1, $t1, 4
  	addi $t2, $t2, -4
  	j print_level
  
 start:
 	
 	li $t0,BASE_ADDRESS # $t0 stores the base address for display 
 	li $s0, START #$s0 stroes the current address(the base of display)
 	li $t1, 0x0000ff # $t1 stores the blue colour code
	li $t2, 0x000000 # $t2 stores the BLACK colour code
	
	#Draw characrer
	sw $t1, 0($s0)
	sw $t1, -256($s0)
	sw $t1, -512($s0)
	
	#Print the heart
	jal draw_heart
	
key_input:
	la $t0, level
	lw $t0, 0($t0)
	li $t1, 3
	beq $t0, $t1, check
	j ki_cont
check:
	jal mp
	j ki_cont

ki_cont:
	
	li   $a0, 30000         # Adjust this value for speed
	jal  delay

	li $t0,BASE_ADDRESS 
	
	#Check if the user is one the ground, if not, start falling
	li $t1, WHITE
	
	lw $t2, 256($s0)
	
	beq $t2, $t1, on_ground
	
	#Check if the user is stepping on red
	li $t1, DANGER
	
	lw $t2, 256($s0)
	
	beq $t2, $t1, hurt
	
	li $t1, 0x0000ff # $t1 stores the blue colour code
	
	j fall

hurt:
	la $t0, health
	lw $t1, 0($t0)
	addi $t1, $t1, -1
	beqz $t1, end_game
	sw $t1, 0($t0)
	jal draw_heart
	j boot


#Function for drawing moving platforms
mp:
	sw $t0, 0($sp)
	addi $sp, $sp, -4
	sw $t1, 0($sp)
	
	la $t0 timer
	lw $t1, 0($t0)
	addi $t1, $t1, -1
	beqz $t1 redraw
	j return
	
redraw:
	la $t0, appear
	lw $t1, 0($t0)
	bgtz $t1 disappear
	j appear_p
	
disappear:
	li $t0, MP_1
 	li $t1, BLACK
 	sw $t1, 0($t0)
 	sw $t1, 4($t0)
 	sw $t1, 8($t0)
 	sw $t1, 12($t0)
 	sw $t1, 16($t0)
 	
 	li $t0, MP_2
 	sw $t1, 0($t0)
 	sw $t1, 4($t0)
 	sw $t1, 8($t0)
 	sw $t1, 12($t0)
 	sw $t1, 16($t0)

 	
 	li $t0, MP_3
 	sw $t1, 0($t0)
 	sw $t1, 4($t0)
 	sw $t1, 8($t0)
 	sw $t1, 12($t0)
 	sw $t1, 16($t0)
 	
 	#Reset the timer
 	la $t0, timer
 	li $t1, 48
 	sw $t1, 0($t0)
 	
 	
 	la $t0, appear
	li $t1, 0
	sw $t1, 0($t0)
	
	
 	lw $t1, 0($sp)
 	addi $sp, $sp, 4
 	lw $t0, 0($sp)
 	jr $ra
	
appear_p:
	li $t0, MP_1
 	li $t1, WHITE
 	sw $t1, 0($t0)
 	sw $t1, 4($t0)
 	sw $t1, 8($t0)
 	sw $t1, 12($t0)
 	sw $t1, 16($t0)
 	
 	li $t0, MP_2
 	sw $t1, 0($t0)
 	sw $t1, 4($t0)
 	sw $t1, 8($t0)
 	sw $t1, 12($t0)
 	sw $t1, 16($t0)

 	
 	li $t0, MP_3
 	sw $t1, 0($t0)
 	sw $t1, 4($t0)
 	sw $t1, 8($t0)
 	sw $t1, 12($t0)
 	sw $t1, 16($t0)
 	
 	#Reset the timer
 	la $t0, timer
 	li $t1, 60
 	sw $t1, 0($t0)
 	
 	
 	la $t0, appear
	li $t1, 1
	sw $t1, 0($t0)
	
	
	
 	lw $t1, 0($sp)
 	addi $sp, $sp, 4
 	lw $t0, 0($sp)
 	jr $ra
	
return:
	sw $t1, 0($t0)
	lw $t1, 0($sp)
 	addi $sp, $sp, 4
 	lw $t0, 0($sp)
 	jr $ra
	
	
	
#Function for making player inincible
add_in:
	sw $t0, 0($sp)
	addi $sp, $sp, -4
	sw $t1, 0($sp)
	addi $sp, $sp, -4
	sw $t2, 0($sp)
	addi $sp, $sp, -4
	sw $t3, 0($sp)
	
	la $t0, level_3
 	li $t1, BASE_ADDRESS
 	li $t2, 16384
 	
	
	j redraw_red
	
redraw_red:
 	beqz $t2, return_draw
  	lw $t3, 0($t0)
  	beq $t3, DANGER, replace_dr
  	j cont_dr
  replace_dr:
  	li $t3, N_DANGER
  	j cont_dr
  cont_dr:
  	sw $t3, 0($t1)
  	addi $t0, $t0, 4
  	addi $t1, $t1, 4
  	addi $t2, $t2, -4
  	j redraw_red
  return_draw:
  	#Erase all other columns
	li $t0, I_3
	li $t1, BLACK
	sw $t1, 0($t0)
	
	sw $t1, 4($t0)
	
	sw $t1, -256($t0)
	
	sw $t1, -252($t0)
	
	
	#Pop
	lw $t3, 0($sp)
	addi $sp, $sp, 4
	lw $t2, 0($sp)
	addi $sp, $sp, 4
	lw $t1, 0($sp)
	addi $sp, $sp, 4
	lw $t0, 0($sp)
	jr $ra
	
	
  	
  
	
	
		


#Function for increasing player jump
add_jump:
	sw $t0, 0($sp)
	addi $sp, $sp, -4
	sw $t1, 0($sp)
	
	
	#operate
	la $t0, picked_j
	li $t1, 1
	sw $t1, 0($t0)
	
	#Erase all other columns
	li $t0, SJ_2
	li $t1, BLACK
	sw $t1, 0($t0)
	
	sw $t1, 4($t0)
	
	sw $t1, -256($t0)
	
	sw $t1, -252($t0)
	
	
	lw $t1, 0($sp)
	addi $sp, $sp, 4
	lw $t0, 0($sp)
	jr $ra
	
#Function for addding one to the health of players
add_health:
	
	#Push the $ra register
	sw $ra, 0($sp)
	
	addi $sp, $sp, -4
	
	sw $t0, 0($sp)
	
	addi $sp, $sp, -4
	
	sw $t1, 0($sp)
	
	addi $sp, $sp, -4
	
	#Mark health_boost has been picked up
	la $t0, picked_h
	li $t1, 1
	sw $t1, 0($t0)
	
	#Erase the power up
	li $t0, HEALTH_1
	
	li $t1, BLACK
	
	sw $t1, 0($t0)
	
	sw $t1, 4($t0)
	
	sw $t1, -256($t0)
	
	sw $t1, -252($t0)
	#Operate
	la $t0, health
	lw $t1, 0($t0)
	addi $t1, $t1, 1
	sw $t1, 0($t0)
	
	
	jal draw_heart
	
	addi $sp, $sp, 4
	
	lw $t1, 0($sp)
	
	addi $sp, $sp, 4
	
	lw $t0, 0($sp)
	
	addi $sp, $sp, 4
	
	lw $ra, 0($sp)
	
	jr $ra
	
	
		
#Function for drawing the user's current health
draw_heart:
	sw $t0, 0($sp)
	
	addi $sp, $sp, -4
	
	sw $t1, 0($sp)
	
	addi $sp, $sp, -4
	
	sw $t2, 0($sp)
	
	addi $sp, $sp, -4
	
	sw $t3, 0($sp)
	
	la $t0, health
	
	lw $t1, 0($t0)
	
	li $t2, PINK
	
	li $t3, BASE_ADDRESS
	
	addi $t3, $t3, 332
	
	
	
print_heart:
	beqz $t1, ph_return
	
	#First row
	sw $t2, 0($t3)
	
	sw $t2, 4($t3)
	
	sw $t2, 8($t3)
	
	sw $t2, 12($t3)
	
	sw $t2, 16($t3)
	
	#Second row
	sw $t2, 260($t3)
	
	sw $t2, 264($t3)
	
	sw $t2, 268($t3)
	
	#Last row
	sw $t2, 520($t3)
	
	#Move to the next position of the heart
	addi $t3, $t3, 32
	
	addi $t1, $t1, -1
	
	j print_heart
	
	
ph_return:
	
	lw $t3, 0($sp)
	
	addi $sp, $sp, 4
	
	lw $t2, 0($sp)
	
	addi $sp, $sp, 4
	
	lw $t1, 0($sp)
	
	addi $sp, $sp, 4
	
	lw $t0, 0($sp)
	
	jr $ra
	

fall:	
	
	li $s1, BUTTOM
	bgt $s0, $s1, end
	#Erase previous cell
	sw $t2, 0($s0)
	sw $t2, -256($s0)
	sw $t2, -512($s0)
	
	#Move the chracter up by -1
	addi $s0, $s0, 256
	
	#Print the chracter
	sw $t1, 0($s0)
	sw $t1, -256($s0)
	sw $t1, -512($s0)
	j key_input

end:
	li $v0, 10
	syscall

on_ground:
	li $t1, 0x0000ff # $t1 stores the blue colour code
	li $t2, 0x000000 # $t2 stores the BLACK colour code
	li $t8, 0xffff0000
	lw $t9, 0($t8)
	beq $t9, 1, key_pressed
	j key_input

	 	 
key_pressed:
	lw $t4, 4($t8)  # Load keycode from the correct memory location
	beq $t4, 0x61, left
	beq $t4, 0x64, right	# ASCII 'd' for right movement
	beq $t4, 0x77, jump_up       # 'w'
	beq $t4, 0x72, restart	#Restart the level
	beq $t4, 0x71, end_game	#End the game
	j key_input
left:	
	#Add detection so that the chracter cannot move outside of the frame
	sub $t4, $s0, $t0
	andi $t5, $t4, 255
	beqz $t5, edge
	
	#Check if the user if moving towards  white
	li $t4, WHITE
	
	lw $t5, -4($s0)
	
	beq $t4, $t5, edge
	
	#Check if the user is stepping on red
	li $t4, DANGER
	
	lw $t5, -4($s0)
	
	beq $t4, $t5, hurt
	
	#Check if the user is stepping on gold
	li $t4, GOLD
	
	lw $t5, -4($s0)
	
	beq $t4, $t5, pass	
	
	#Erase previous cell
	sw $t2, 0($s0)
	sw $t2, -256($s0)
	sw $t2, -512($s0)
	#Increment by one unit
	addi $s0, $s0, -4
	j print_char
	
	
right:	#Add detection so that the chracter cannot move outside of the frame
	sub $t4, $s0, $t0
	subi $t4, $t4, 252
	andi $t5, $t4, 255
	beqz $t5, edge
	
	#Check if the user is stepping on red
	li $t4, DANGER
	
	lw $t5, 4($s0)
	
	beq $t4, $t5, hurt	
	
	#Check if the user is moving towards white
	li $t4, WHITE
	
	lw $t5, 4($s0)
	
	beq $t4, $t5, edge	
	
	#Check if the user is stepping on gold
	li $t4, GOLD
	
	lw $t5, 4($s0)
	
	beq $t4, $t5, pass	
	
	
	#Erase previous cell
	sw $t2, 0($s0)
	sw $t2, -256($s0)
	sw $t2, -512($s0)
	#Decrease by one unitaaa
	addi $s0, $s0, 4
	j print_char

edge:
	j key_input
	
jump_up:
	#The character will ascend for 8 units
	sw $t0 0($sp) #push $to onto stack
	
	la $t0, picked_j
	
	lw $t0, 0($t0)
	
	bgtz $t0, super
	
	j normal

super: 
	
	addi $t0, $zero, 27
	
	addi $s2, $zero, 10
	
	j j_loop

normal:
	
	addi $t0, $zero, 10
	
	addi $s2, $zero, 4
	
	addi $t5, $zero, 0
	
	j j_loop
	
call_add:
	jal add_health
	j Cont
	
call_jump:
	jal add_jump
	j Cont
	
call_in:
	move $s4, $s0
	jal add_in
	j Cont
	
j_loop:
   	 beq  $t0, $zero, fall_down
   	
   	 #Check if the user is hitting the white 
   	 li $t3, WHITE
	
	lw $t4, -768($s0)
	
	beq $t3, $t4, fall_down
	
	#Check if user is hitting health pickup
	li $t3, PINK
	
	lw $t4, -768($s0)
	
	beq $t3, $t4, call_add
	
	#Check if user is hitting jump pickup
	li $t3, GREEN
	
	lw $t4, -768($s0)
	
	beq $t3, $t4, call_jump
	
	#Check if user is hitting invincible pickup
	li $t3, BLUE
	
	lw $t4, -768($s0)
	
	beq $t3, $t4, call_in
	
	#check if user is in level 3
   	la $t3, level
   	lw $t3, 0($t3)
   	li $t4, 3
   	beq $t3, $t4, call_mp
   	j Cont
call_mp:
	jal mp

Cont:
	
    	# Erase previous cell	
    	sw $t2, 0($s0)
    	sw $t2, -256($s0)
    	sw $t2, -512($s0)
    	
    	#Move the chracter up by -1
	addi $s0, $s0, -256
	jal move_in_air
	
	
	#Print the chracter
	sw $t1, 0($s0)
	sw $t1, -256($s0)
	sw $t1, -512($s0)
	
	addi $t0, $t0, -1
	addi $t5, $t5, 1
	
	li   $a0, 30000         # Adjust this value for speed
	jal  delay
	
	j j_loop
   
fall_down:
	move $t0, $t5
	addi $s2, $zero 4
	j f_loop

	
call_add_f:
	jal add_health
	j Cont_f
	
call_add_i_f:
	move $s4, $s0
	jal add_in
	j Cont_f
	
		
f_loop: 
	beq  $t0 $zero jump_return
	
	#Check if the user is one the ground, if not, start falling
	li $t3, WHITE
	
	lw $t4, 256($s0)
	
	beq $t3, $t4, on_ground
	
	
	#Check if the user is stepping on red
	li $t3, DANGER
	
	lw $t4, 256($s0)
	
	beq $t3, $t4, hurt
	
	#Check if the user is stepping on gold
	li $t3, GOLD
	
	lw $t4, 256($s0)
	
	beq $t3, $t4, pass

	#Check if the user is stepping on pink
	li $t3, PINK
	
	lw $t4, 256($s0)
	
	beq $t3, $t4, call_add_f
	
	#Check if the user is stepping on blue
	li $t3, BLUE
	
	lw $t4, 256($s0)
	
	beq $t3, $t4, call_add_i_f
	
	#check if user is in level 3
   	la $t3, level
   	lw $t3, 0($t3)
   	li $t4, 3
   	beq $t3, $t4, call_mp_f
   	j Cont_f
call_mp_f:
	jal mp

Cont_f:
	
	#Erase previous cell
	sw $t2, 0($s0)
	sw $t2, -256($s0)
	sw $t2, -512($s0)
	
	#Move the chracter up by -1
	addi $s0, $s0, 256
	jal move_in_air
	
	
	#Print the chracter
	sw $t1, 0($s0)
	sw $t1, -256($s0)
	sw $t1, -512($s0)
	
	addi $t0, $t0, -1
	
	li   $a0, 30000         # Adjust this value for speed
	jal  delay
	
	j f_loop

jump_return:
	#pop $t0 off the stack
	
	j key_input	
	
print_char:
	#Print the chracter
	sw $t1, 0($s0)
	sw $t1, -256($s0)
	sw $t1, -512($s0)
	
	j key_input
	
delay:
delay_loop:
    addi $a0, $a0, -1
    bnez $a0, delay_loop
    jr   $ra



	
move_in_air:
	beqz $s2, limit
	lw $t4, 4($t8)  # Load keycode from the correct memory location
	beq $t4, 0x61, a_left
	beq $t4, 0x64, a_right	# ASCII 'd' for right movement
	jr $ra

limit:	
	jr $ra


call_add_a_l:
	jal add_health
	
	j alc
	
call_add_a_r:
	jal add_health
	j arc
	
call_add_j_l:
	jal add_jump
	j alc
	
call_add_j_r:
	jal add_jump
	j arc

call_add_i_l:
	move $s4, $s0
	jal add_in
	j alc

call_add_i_r:
	move $s4, $s0
	jal add_in
	j arc
	

a_left:
	#If the chracter is at the edge, then it caanot go further left
	sw $t0, 0($sp)
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	addi $sp, $sp, -4
	li $t0,BASE_ADDRESS
	sub $t4, $s0, $t0
	andi $t5, $t4, 255
	beqz $t5, edge_a
	
	#Else if the chracter is being blocked by a white cube, it also cannot go further left
	li $t3, WHITE
	lw $t4, -4($s0)
	beq $t3, $t4, edge_a
	
	lw $t4, -260($s0)
	beq $t3, $t4, edge_a
	
	lw $t4, -516($s0)
	beq $t3, $t4, edge_a
	
	#Else if the chracter is moving towards a red cube
	li $t3, DANGER
	lw $t4, -4($s0)
	beq $t3, $t4, hurt
	
	lw $t4, -260($s0)
	beq $t3, $t4, hurt
	
	lw $t4, -516($s0)
	beq $t3, $t4, hurt
	
	#Else if the character is moving towards gold
	li $t3, GOLD
	
	lw $t4, -4($s0)
	beq $t3, $t4, pass
	
	lw $t4, -260($s0)
	beq $t3, $t4, pass
	
	lw $t4, -516($s0)
	beq $t3, $t4, pass
	
	#Else if the character is moving towards pink
	li $t3, PINK
	
	lw $t4, -4($s0)
	beq $t3, $t4, call_add_a_l
	
	lw $t4, -260($s0)
	beq $t3, $t4, call_add_a_l
	
	lw $t4, -516($s0)
	beq $t3, $t4, call_add_a_l
	
	#Else if the character is moving towards GREEN
	li $t3, GREEN
	
	lw $t4, -4($s0)
	beq $t3, $t4, call_add_j_l
	
	lw $t4, -260($s0)
	beq $t3, $t4, call_add_j_l
	
	lw $t4, -516($s0)
	beq $t3, $t4, call_add_j_l
	
	#Else if the character is moving towards BLUE
	li $t3, BLUE
	
	lw $t4, -4($s0)
	beq $t3, $t4, call_add_i_l
	
	lw $t4, -260($s0)
	beq $t3, $t4, call_add_i_l
	
	lw $t4, -516($s0)
	beq $t3, $t4, call_add_i_l
	
alc:
	addi $s0, $s0, -4
	addi $s2, $s2, -1
	
	addi $sp, $sp, 4
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	lw $t0, 0($sp)
	jr $ra

a_right:
	sw $t0, 0($sp)
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	addi $sp, $sp, -4
	li $t0,BASE_ADDRESS
	sub $t4, $s0, $t0
	sub $t4, $t4, 252
	andi $t5, $t4, 255
	beqz $t5, edge_a
	
	
	#Else if the chracter is being blocked by a white cube, it also cannot go further right
	li $t3, WHITE
	lw $t4, 4($s0)
	beq $t3, $t4, edge_a
	
	lw $t4, -252($s0)
	beq $t3, $t4, edge_a
	
	lw $t4, -508($s0)
	beq $t3, $t4, edge_a
	
	#Else if the chracter is moving towards a red cube
	#Check if the user is stepping on red
	li $t3, DANGER
	
	lw $t4, 4($s0)
	beq $t3, $t4, hurt
	
	lw $t4, -252($s0)
	beq $t3, $t4, hurt
	
	lw $t4, -508($s0)
	beq $t3, $t4, hurt
	
	#Else if the user is moving towards gold
	li $t3, GOLD
	
	lw $t4, 4($s0)
	beq $t3, $t4, pass
	
	lw $t4, -252($s0)
	beq $t3, $t4, pass
	
	lw $t4, -508($s0)
	beq $t3, $t4, pass
	
	#Else if the user is moving towards pink
	li $t3, PINK
	
	lw $t4, 4($s0)
	beq $t3, $t4, call_add_a_r
	
	lw $t4, -252($s0)
	beq $t3, $t4, call_add_a_r
	
	lw $t4, -508($s0)
	beq $t3, $t4, call_add_a_r
	
	#Else if the user is moving towards green
	li $t3, GREEN
	
	lw $t4, 4($s0)
	beq $t3, $t4, call_add_j_r
	
	lw $t4, -252($s0)
	beq $t3, $t4, call_add_j_r
	
	lw $t4, -508($s0)
	beq $t3, $t4, call_add_j_r
	
	#Else if the user is moving towards BLue
	li $t3, BLUE
	
	lw $t4, 4($s0)
	beq $t3, $t4, call_add_i_r
	
	lw $t4, -252($s0)
	beq $t3, $t4, call_add_i_r
	
	lw $t4, -508($s0)
	beq $t3, $t4, call_add_i_r

arc:
	addi $s0, $s0, 4
	addi $s2, $s2, -1
	
	addi $sp, $sp, 4
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	lw $t0, 0($sp)
	jr $ra	

edge_a:
	addi $sp, $sp, 4
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	lw $t0, 0($sp)
	jr $ra
	

end_game:
	la $t0, finish
 	li $t1, BASE_ADDRESS
 	li $t2, 16384
 
 print_finish: 	
 	beqz $t2, end_choice
  	lw $t3, 0($t0)
  	sw $t3, 0($t1)
  	addi $t0, $t0, 4
  	addi $t1, $t1, 4
  	addi $t2, $t2, -4
  	j print_finish
  	
 end_choice:
  	#Reset the level to 1
  	la $t0, level
  	li $t1, 1
  	sw $t1, 0($t0)
  	
  	#Reset health to 3
  	la $t0, health
	lw $t1, 0($t0)
	addi $t1, $zero, 3
	sw $t1, 0($t0)
	
	#Reset the power ups
	la $t0, picked_h
	li $t1, 0
	sw $t1, 0($t0)
	
	la $t0, picked_j
	li $t1, 0
	sw $t1, 0($t0)
	
	la $t0, picked_i
	li $t1, 0
	sw $t1, 0($t0)
	
	#Reset timer
	la $t0, timer
	li $t1, 60
	sw $t1, 0($t0)
	
	#Reset appear flag
	la $t0, appear
	li $t1, 1
	sw $t1, 0($t0)
	
  	
  	li $t8, 0xffff0000
	lw $t9, 0($t8)
	beq $t9, 1, key_pressed_e
	j end_choice
  	
  key_pressed_e:
  	lw $t4, 4($t8)  # Load keycode from the correct memory location
	beq $t4, 0x72, boot	#Restart the level
	j end_choice
	
	
pass:
	#Move to next level
	la $t0, level
  	lw $t1, 0($t0)
  	addi $t1, $t1, 1
  	sw $t1, 0($t0)
  	li $t0, 4
  	beq $t1, $t0, win_s
  	
  	#Restore the picked_up values to 0
  	la $t0, picked_h
  	li $t1, 0
  	sw $t1, 0($t0)
  	
  	la $t0, picked_j
  	li $t1, 0
  	sw $t1, 0($t0)
  	
  	j boot

win_s:
	la $t0, win
 	li $t1, BASE_ADDRESS
 	li $t2, 16384
 	j print_finish
	
	
  	
	

